script_1:
function getCookie(name) {
    var value = "; " + document.cookie;
    var parts = value.split("; " + name + "=");
    if (parts.length == 2) return parts.pop().split(";").shift();
}

var items = 'Home'.split(',');
var pageDepth = items.length;
var ccpCookie = getCookie('CCP');
var ccpCookieValues = {cat2:'off',cat3:'off',cat4:'off'};
var newReturning = 'undefined' !== typeof getCookie('CCP_OTM') ? "returning" : "new";
var categoryTags = ''.split(',');
var categoryTagIds = ''.split(',');

if ('undefined' !== typeof ccpCookie) {
    var decodedCcpCookieValues = JSON.parse(decodeURIComponent(getCookie('CCP')));
    if ('undefined' !== typeof decodedCcpCookieValues.publicuser){
        ccpCookieValues = decodedCcpCookieValues.publicuser
    }
}

var digitalData = {
    page: {
        pageInfo: {
            pageName: items.join(':'),
            cmsPageName: 'home',
            cmsPath: '\/content\/home\u002Dbarclays\/en\/home',
            level1: items[0],
            level2: pageDepth > 1 ? items[1] : '',
            level3: pageDepth > 2 ? items[2] : '',
            level4: pageDepth > 3 ? items[3] : '',
            urlProtocol: document.location.protocol,
            urlHost: document.location.hostname,
            urlPath: document.location.pathname,
            urlQueryString: document.location.search,
            urlHash: document.location.hash,
            urlContent: "",
            templateId: "\/apps\/componentlibrary\/templates\/page_standard_fullwidth",
            pageId:  "",
            breadcrumb: items.join('>'),
            accessibility: "",
            segment: items[0],
            pageVersion: "",
            impressions: "",
            buildVersion: "",
            applicationId: "",
            applicationType: "",

            // W3C Data Layer recommendation
            timeStamp: new Date(),
            destinationURL: document.location,
            referringURL: document.referrer,
            breadCrumbs: items,
            categoryTags:{
                tags: categoryTags,
                tagIds: categoryTagIds
            }
        },
        searchInfo: {},
        linkInfo: {
            dl_category: ""
        }
    },
    user: {
        ccp: {
            cat2: ccpCookieValues.cat2,
            cat3: ccpCookieValues.cat3,
            cat4: ccpCookieValues.cat4
        },
        newReturning: newReturning,
        external: ""
    },
    events: []
};

