_satellite["_runScript2"](function(event, target, Promise) {
// Set Adobe Preferences only if Adobe products are in use
if (typeof adobe.optIn != "undefined") {

  //Listen for specific event triggered when user updates their preference by clicking save button
  window.addEventListener('UserInteraction', function(e){

    var eventAction = e.detail.action;

    //Only update preferences if the Event action is PECR update
    if (eventAction == "PECRPreferencesUpdated") {

      //Check Adobe Analytics and ECID is accepted - Category 2 (TBD)
      if (_satellite.getVar('userConsentCat2')) {
        adobe.optIn.approve(adobe.OptInCategories.ANALYTICS,true);
        adobe.optIn.approve(adobe.OptInCategories.ECID,true);
      } else {
        adobe.optIn.deny(adobe.OptInCategories.ANALYTICS,true);
        adobe.optIn.deny(adobe.OptInCategories.ECID,true);
      }

      //Check Target and Marketing pixels is accepted - Category 4 (TBD)
      if (_satellite.getVar('userConsentCat4')) {    
        adobe.optIn.approve(adobe.OptInCategories.TARGET,true);
      } else {
        adobe.optIn.deny(adobe.OptInCategories.TARGET,true);
      }

      adobe.optIn.complete();
    }
  }, false);
}
});
